// Header.js
import React from 'react';

const Header = () => {
  return (
    <header>
      {/* Your header content here */}
      <h1>App Name</h1>
      <nav>
        <ul>
          <li>Features</li>
          <li>Download</li>
          <li>About</li>
          {/* Add more navigation items as needed */}
        </ul>
      </nav>
    </header>
  );
}

export default Header;
